  "Allegations" : "**06/18/2001** EVENT: STIPULATION OF FACTS AND CONSENT TO PENALTY EXECUTED; HEARING SCHEDULED FOR JUNE 19, 2001 PLEASE BE ADVISED THAT THE EXCHANGE AND JESSE POWELL FISHER, SR. HAVE EXECUTED A STIPULATION OF FACTS AND CONSENT TO PENALTY OF A CENSURE AND A FOUR-WEEK SUSPENSION WITH RESPECT TO THE FOLLOWING CHARGES: CHARGE I JESSE POWELL FISHER, BY REASON OF THE FACTS SET FORTH IN THE STATEMENT OF FACTS AND EXPLANATION, VIOLATED EXCHANGE RULE 408(A) IN THAT, HE EXERCISED DISCRETION IN THE ACCOUNTS OF ONE OR MORE CUSTOMERS OF  HIS MEMBER ORGANIZATION EMPLOYER WITHOUT FIRST OBTAINING WRITTEN AUTHORIZATION OF THE CUSTOMERS AND, AND HE IS, THEREFORE, SUBJECT TO DISCIPLINE PURSUANT TO EXCHANGE RULE 476(A). CHARGE II JESSE POWELL FISHER, BY REASON OF THE FACTS SET FORTH IN THE STATEMENT OF FACTS AND EXPLANATION, CAUSED VIOLATIONS OF EXCHANGE RULE 440 AND SEC RULES 17A-3 IN THAT ON ONE OR MORE OCCASIONS HE MIS-MARKED ORDER TICKETS AS UNSOLICITED FOR TRADES WHEN IN FACT SUCH TRADES WERE EFFECTED ON A DISCRETIONARY BASIS, AND HE IS, THEREFORE, SUBJECT TO DISCIPLINE PURSUANT TO EXCHANGE RULE 476(A).",
