  "Sanction Details" : "**06/19/2001** DECISION 01-107 - ISSUED BY THE NYSE HEARING PANEL THE HEARING PANEL, ACCEPTING A STIPULATION OF FACTS AND CONSENT TO PENALTY, FOUND THAT FISHER EXERCISED DISCRETION IN CUSTOMERS' ACCOUNTS WITHOUT WRITTEN AUTHORIZATION AND CAUSED VIOLATIONS OF RULE 440 AND SEC RULE 17A-3 IN THAT HE MISMARKED ORDER TICKETS AS UNSOLICITED WHEN THE TRANSACTIONS WERE SOLICITED AND DISCRETIONARY. CONSENT TO CENSURE AND A FOUR-WEEK SUSPENSION.",
